window.bookSummaryJSON = "<p><b>It all happened so fast. One minute Rowan was dying, the next he’d made the biggest mistake of his life.</b></p> <p>The Supernatural Academy nearly killed me my freshman year, so when my sophomore year rolls around, I’m determined for things to be different. Sure, Rowan’s a mess, but he’s still studying magic and taking me on hot dates, and that’s all that matters. But what I don’t realize is how freaking obsessed he's become with finding a cure to reverse his new curse.</p> <p>He wants magic back, and he’s willing to do anything to get it. </p> <p>It’s not enough that I sign a blood pact with him, giving him access to my magic. And it’s not enough when he loses control. No, nothing will stop him from getting what he wants, which puts him and everyone in his path in danger. </p> <p>The problem now is figuring out just how far I’m willing to go to save Rowan. And what will be left when it's over.</p> <p>You will love the continuation of this magical academy series with kick-ass action, hot romance, and earth-shattering magic that will make you tingle in all the right places.</p> <p><b>The exciting sequel to the Amazon best seller </b><b><i>Freshman Witch</i></b><b>. Get it now.</b></p>"; 
